import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Home from './pages/Home';
import Notfound from './pages/Notfound';
import Fastcastle from './pages/Fastcastle';
import Rusharcher from './pages/Rusharcher';
import Scootrush from './pages/Scootrush';

const App = () => {
  return (
    <>
      <BrowserRouter>
        <switch>
          <Route path="/" exact component={Home} />
          <Route component={Notfound} />
          <Route path="/Fastcastle" component={Fastcastle} />
          <Route path="/Rusharcher" component={Rusharcher} />
          <Route path="/Scootrush" component={Scootrush} />
        </switch>
      </BrowserRouter>
    </>
  );
};

export default App;
